import './App.css';

function App() {
  const handelChange = ()=>{
    const names= ['yuvi','kalu','naku']
    const int = Math.floor(Math.random(names)*3);
    return int[names];
  }
  return (
    <div className="App">
      <header className="App-header">

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p>Hello {handelChange()} !</p>
      </header>
    </div>
  );
}

export default App;
